classes.content:
self {
  text-align : left;
  font : normal normal normal 14px/20px Noto Sans CJK KR;
  letter-spacing : 0px;
  color : #e70fe7ff;
  margin-left : 20px;
  margin-right : 35px;
	font-size: 30px;
}

self {
  color : #3b82f6ff;
  font-weight : 700;
  font-size : 15px;
  margin-left : 10px;
  margin-right : 10px;
  margin-bottom : 10px;
  margin-top : 10px;
}

self {
  font-size : 12px;
  color: #3e5b77;
}

self > .selected
{
    display: flex;
    justify-items: center;
    flex-direction : row;
    height: 30px;
    background-color:#1f89fe;
    border-radius: 12px;
    color: white;
    font-weight: 700;
    border-color: #382e4e;
    padding-left:25px;
    padding-right:25px;
}

self {
  width : 69px;
  height : 69px;
  background-color : #2289FF;
  color : #ffffffff;
  border-radius : 9999px;
  display : flex;
  justify-content : center;
  align-items : center;
  cursor : pointer;
  transition: width ease-in-out 200ms;
  transform-origin: right;
  overflow: hidden;
  position: absolute;
  font-weight: 700;
  font-size: 18px;
  box-shadow : 3px 4px 9px -3px rgba(0,0,0,0.75);
  top : 85%;
  left: 80%;
}

self:hover {
  background-color :  #3959A5;
  width: 150px;
}

self > .fd-statictext {
  display: none;
  min-width: 70px;
  margin-left: 12px;
}

self:hover > .fd-statictext {
  display: block;
}

self {

}

self .header .header-cell {
  background-color: #eff9f4;
  color: #6fc295;
  font-weight: 600;
  padding: 1.25rem 2rem;
	  text-align: center;
}

self .row {

}

self .row .cell {
  padding: 1.5rem 2rem;
}

self .row .cell > span {
  justify-content: flex-start;
}

self .row.selected {
  background-color: #f5f6fe;
}

self .header .resizable > :not([hidden]) ~ :not([hidden]),
self .row > :not([hidden]) ~ :not([hidden]),
self .Grid .innerScrollContainer,
self .Grid .innerScrollContainer > :not([hidden]) ~ :not([hidden]) {
  border-width: 0;
}
